import './App.css';
import { React} from 'react';


function SignUp() {
 
  const submitData=async(e)=>{
    e.preventDefault();
    const username=document.getElementById("name_id").value;
    const password=document.getElementById("password_id").value;

    const response=await fetch('http://localhost:3000/SignUp',{
      method:'POST',
      body:JSON.stringify(username,password),
      headers:{
        'Content-Type':'application/json'
      }
    });

    console.log(response);
  }
  return (
    <>
      <div className="h-40 my-3 flex justify-center">
        <form method="post">
          <fieldset className='border-4 border-double border-purple-900 h-96 w-96'>
            <legend className='flex mx-auto'>Sign Up DETAILS</legend>
            <label htmlFor="name_id" className='ml-10 relative top-4'>Username</label> <br />
            <input className='h-10 ml-10 mt-4 border-4 border-gray w-72 rounded-md ' required="required" type="text" id="name_id" placeholder='Enter your Username' />
            <br />
            <label htmlFor="number_id" className='ml-10 top-4 relative' >Password</label> <br />
            <input className='h-10 ml-10 mt-4 border-4 border-gray w-72' required="required" type="password" name="password_name" id="password_id" placeholder='Enter your Password' />
            <input className='h-10 ml-10 mt-4 border-4 border-gray w-72' required="required" type="password" name="password_name" id="password_id" placeholder='Re-Enter your Password' />
            <br />
            <button onClick={submitData}  className="bg-green-700 hover:bg-green-400 mt-4 ml-10 w-72 h-10">Sign Up</button>
          </fieldset>
        </form>
      </div>
    </>
  );
}

export default SignUp;
